import React, { Component } from 'react';
import './TabOption.css';
export class TabOption extends Component
 {

  constructor(props)
  {
      super(props);
  }
  render() 
  {
    return <div className='tab_option'>
        <span className='tab_name'>{this.props.name}</span>
    </div>;
  }
}
export default TabOption;
